package com.servinglynk.hmis.warehouse.notification.persistence.entity;import java.util.HashSet;import java.util.Set;import javax.persistence.CascadeType;import javax.persistence.Column;import javax.persistence.Entity;import javax.persistence.FetchType;import javax.persistence.GeneratedValue;import javax.persistence.GenerationType;import javax.persistence.Id;import javax.persistence.OneToMany;import javax.persistence.SequenceGenerator;import javax.persistence.Table;@SuppressWarnings("serial")@Entity@Table(name = "HMIS_TEMPLATE_HEADER" )public class TemplateHeaderEntity extends ParentEntity {	private Long id;		@Id	@SequenceGenerator(name="pk_sequence",sequenceName="hmis_template_header_id_seq", allocationSize=1)	@GeneratedValue(strategy=GenerationType.SEQUENCE,generator="pk_sequence")	public Long getId() {		return id;	}	private String externalId;	private String friendlyName;	private Set<TemplateLineEntity> templateLines = new HashSet<TemplateLineEntity>(0);	public void setId(Long id) {		this.id = id;	}		@Column(name = "external_id")	public String getExternalId() {		return externalId;	}	public void setExternalId(String externalId) {		this.externalId = externalId;	}	@Column(name = "friendly_name")	public String getFriendlyName() {		return friendlyName;	}	public void setFriendlyName(String friendlyName) {		this.friendlyName = friendlyName;	}	@OneToMany(cascade = CascadeType.ALL, fetch = FetchType.LAZY, mappedBy = "templateHeader")	public Set<TemplateLineEntity> getTemplateLines() {		return templateLines;	}	public void setTemplateLines(Set<TemplateLineEntity> templateLines) {		this.templateLines = templateLines;	}		}